import React from 'react';
import NewProject from '../projects/NewProject';
import ProjectList from '../projects/ProjectList';

const Sidebar = () => {
    return ( 
        <aside>
            <h1>MM<span>Tasks</span></h1>
            <NewProject/>
            <div className="proyectos">
                <h2>Mis Proyectos</h2>
                <ProjectList/>
            </div>
        </aside>
     );
}

export default Sidebar;
